import './index.css';

export default function SelectedInput({value, onInputChange}) {
  if (value === 1) {
    return (
      <div className="input-selection-button">
        <h2>Weight 1</h2>
        <input type="number" name="weight" placeholder="Your current weigth" 
        onInput={e => onInputChange(e.target.value)}/>
      </div>
    );     
  }

  if (value === 2) {
    return (
      <div className="input-selection-button">
        <h2>Bench press 2</h2>
        <input type="number" name="bench-weight" placeholder="Weight" />
        <input type="number" name="bench-reps" placeholder="Reps" />
      </div>
    );     
  }

  if (value === 3) {
    return (
      <div className="input-selection-button">
        <h2>Squat 3</h2>
        <input type="number" name="squat-weight" placeholder="Weight" />
        <input type="number" name="squat-reps" placeholder="Reps" />
      </div>
    );     
  }

  if (value === 4) {
    return (
      <div className="input-selection-button">
        <h2>Dead lift 4</h2>
        <input type="number" name="deadlift-weight" placeholder="Weight" />
        <input type="number" name="deadlift-reps" placeholder="Reps" />
      </div>
    );     
  }
    return (
      <div className="input-selection-button">
        <h2>Pullups 5</h2>
        <input type="number" name="pullup-reps" placeholder="Reps" />
      </div>
    );     
}
